import Loader from 'react-loaders'


const LoadingAnimation = () => {
    let loaderOptions = [
        'pacman',
        'ball-zig-zag-deflect',
        'ball-beat',
        'line-scale-random'
    ]

    let i = Math.floor(Math.random() * loaderOptions.length);

    let choice = loaderOptions[i];



    return (
        <Loader type={choice} />
    )
}

export default LoadingAnimation;
